export async function sendToDeepSeek(message) {
  const response = await fetch("http://localhost:11434/api/chat", {
    method: "POST",
    headers: { "Content-Type": "application/json" },
    body: JSON.stringify({
  model: "deepseek-coder",
  messages: [
    {
      role: "system",
  "content": "You are DeepSeek, an advanced AI assistant. You can help with a wide range of questions, including travel planning, currency conversion, programming, general knowledge, and more. Be accurate, helpful, and polite. Respond in detail, and use examples where appropriate."    },
    { role: "user", content: message }
  ],
  stream: false
})

  });

  const data = await response.json();
  return data.message.content;
}
